import "./Navbar.css"
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <>
            <div className="nabar-container">
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
            </div>
        </>
    )
}

export default Navbar
